import React from 'react'
import "leaflet/dist/leaflet.css";

import { MapContainer } from "react-leaflet/lib/MapContainer";
import { TileLayer } from "react-leaflet/lib/TileLayer";
import { Marker } from "react-leaflet/lib/Marker";
import { Popup } from "react-leaflet/lib/Popup";


function Map() {
  return (
    <MapContainer center={[51.505, -0.09]} zoom={13} scrollWheelZoom={false}  style={{ height: 536 }}>
  <TileLayer
    attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
    url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
  />
  <Marker position={[51.505, -0.09]}>
    <Popup>
      A pretty CSS3 popup. <br /> Easily customizable.
    </Popup>
  </Marker>
</MapContainer>
  )
}

export default Map
